  \"2013-03-15T23:35:33.117966\",\n\t\"name\": \"geothermal-power-from-wells-in-non-convective-sedimentary-formations-an-engineering-economic-an\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Many sedimentary formations, including
  some that contain oil or gas, may be hot enough to serve as commercial geothermal
  reservoirs. Unlike conventional geothermal reservoirs which generally occur in fractured
  formations, these reservoirs have intergranular porosity, which allows relatively
  easy estimation of the hydraulic characteristics of a well from cores and well logs.
  Using these estimates, the wells power capacity can be estimated for various well
  production options (such as, pumped or self-flowing) and power generation technology
  options (such as, binary, flash or hybrid).\",\n\t\"license_title\": null,\n\t\"extras\":
